  false,\n\t\"url\": null,\n\t\"notes\": \"In 1984, the U.S. Geological Survey (USGS),
  Office of Marine Geology, launched a program using the Geological LOng-Range Inclined
  Asdic (GLORIA) sidescan-sonar system to study the entire U.S. Exclusive Economic
  Zone (EEZ). From December 1990 through February 1991, the USGS and IOS (Institute
  of Oceanographic Sciences, U.K.) scientists conducted three surveys within the Johnston
  Atoll U.S. EEZ surrounding Johnston Island. The results of these surveys were 16
  digital mosaics of a 2 degree by 2 degree area with a 50-meter pixel resolution.\",\n\t\"license_title\":
